Сделка удовлетворяет одновременно следующим условиям:
одна из сторон сделки является налогоплательщиком, указанным в пункте 1 статьи 275.2 Налогового кодекса Российской Федерации, и учитывает доходы (расходы) по такой сделке при определении налоговой базы по налогу на прибыль организаций в соответствии со статьей 275.2 Налогового кодекса Российской Федерации;
любая другая сторона сделки не является налогоплательщиком, указанным в пункте 1 статьи 275.2 Налогового кодекса Российской Федерации, либо является налогоплательщиком, указанным в пункте 1 статьи 275.2 Налогового кодекса Российской Федерации, но не учитывает доходы (расходы) по такой сделке при определении налоговой базы по налогу на прибыль организаций в соответствии со статьей 275.2 Налогового кодекса Российской Федерации (подпункт 6 пункта 2 статьи 105.14 Налогового кодекса Российской Федерации)

доходы в денежной и (или) натуральной формах, полученные общероссийским общественным объединением, осуществляющим свою деятельность в соответствии с законодательством Российской Федерации об общественных объединениях, Олимпийской хартией Международного олимпийского комитета и на основе признания Международным олимпийским комитетом, или общероссийским общественным объединением, осуществляющим свою деятельность в соответствии с законодательством Российской Федерации об общественных объединениях, Конституцией Международного паралимпийского комитета и на основе признания Международным паралимпийским комитетом, а именно:
доходы от реализации рекламных услуг, в том числе спонсорской рекламы;
доходы от реализации имущественных прав (в том числе прав использования результатов интеллектуальной деятельности и (или) средств индивидуализации);
в виде имущества (включая денежные средства) и имущественных прав, полученных от автономной некоммерческой организации «Организационный комитет XXII Олимпийских зимних игр и XI Паралимпийских зимних игр 2014 года в г.Сочи»;
доходы, полученные от размещения временно свободных денежных средств (положение действует до 1 января 2017 года)

не является налоговым резидентом Российской Федерации, но:
- признается участником Государственной программы по оказанию содействия добровольному переселению в Российскую Федерацию соотечественников, проживающих за рубежом;
- является членом экипажа судна, плавающего под Государственным флагом Российской Федерации;
- является иностранным гражданином или лицом без гражданства, признанным беженцем или получившим временное убежище на территории Российской Федерации в соответствии с Федеральным законом от 19 февраля 1993 г. N 4528-1 «О беженцах»
